import React from "react";


const Navmenuitems = ()=> {
  return
  (<div className='navbar'>
      <h1>Trippy</h1> 
      <div className='nav-menu'>
        <ul>
          <i></i>
          <a href='/'>Home</a>
        </ul>
      </div>
      </div>
)}
export default Navmenuitems;
